





































<html>



<body onload="
    var now = (new Date()).getTime();  
    var begin = document.location.search.split('=')[1]; // ?begin=nnnnn
    var startupTime = now - begin;
	document.write('\n\nStartup time = ' + startupTime + ' ms<br>');
    if (window.dump) {
      dump('__start_report' + startupTime + '__end_report\n\n');
    }
    window.close();
">
</body>
</html>
